// Home.js
import React from 'react';
import './Home.css';
import Footer from './Footer';
import Header from './Header';

const Home = () => {
  return (
    <div>

    <div className="home">
      <div className="background" style={{ backgroundImage: `url("/images/homepage.png")` }}></div>
      <div className="overlay-image" style={{ backgroundImage: `url("/images/homepage2.png")` }}></div>
      <div className="overlay-text">

          <ol>
          <h3>Steps to Charge: </h3>
            <li>Find the charger via App.</li>
            <li>Just plug it in*</li>
          </ol>

        </div>
        <div className="overlay-text1">
        <p>*You may require manual authentication if your <br/>vehicle doesn't support Plug & Charge feature</p>
        </div>
    </div>

    </div>

  );
};

export default Home;
